import React, { useState } from "react";
import axios from "axios";
import mongoose from "mongoose";
import cors from "cors";

function Testing() {
  // var APIsearchkey = "http://localhost:5000/api/furniture" + searchText;
  const [furniture, setFurniture] = useState({});
  const getFurnitures = () => {
    axios
      .get("http://localhost:5000/api/furniture")
      .then((res) => {
        console.log(res.data);
        setFurniture(res.data.content);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  return (
    <div>
      <h1>Hello this is the data</h1>
      <button onClick={getFurnitures}>Get the data</button>
      <p>{furniture}</p>
    </div>
  );
}

export default Testing;

